import styled from "styled-components"
import { Mic, Headset, Settings } from 'styled-icons/material'

export const Container = styled.div`
    grid-area: UI;

    display: flex;
    align-items: center;
    justify-content: space-between;

    padding: 10px;
    background-color: var(--quaternary);
    box-shadow: rgba(0, 0, 0, .2) 0px 1px 0px 0px;
`

export const Profile = styled.div`
    display: flex;
    align-items: center;
`
export const Avatar = styled.div`
    width: 32px;
    height: 32px;
    border-radius: 50%;

    background-color: var(--gray);
`
export const UserData = styled.div`
    margin-left: 8px;

    display: flex;
    flex-direction: column;
    
    > strong {
        font-size: 13px;
        color: var(--white);
        display: block;
    }
    
    > span {
        color: var(--gray);
        font-size: 13px;
    }
`
export const Icons = styled.div`
    display: flex;
    align-items: center;
    
    > svg:not(:first-child) {
        
    }

`

export const MicIcon = styled(Mic)`
    width: 32px;
    height: 32px;

    border-radius: 4px;
    padding: 5px;

    position: relative;

    color: var(--symbol);
    cursor: pointer;

    transition: color .2s;

    &:hover {
        color: var(--white);
        background-color: var(--quinary);
    }
`
export const HeadphoneIcon = styled(Headset)`
    width: 32px;
    height: 32px;

    border-radius: 4px;
    padding: 5px;

    position: relative;

    color: var(--symbol);
    cursor: pointer;

    transition: color .2s;

    &:hover {
        color: var(--white);
        background-color: var(--quinary);
    }
`
export const SettingsIcon = styled(Settings)`
    width: 32px;
    height: 32px;

    border-radius: 4px;
    padding: 5px;

    position: relative;

    color: var(--symbol);
    cursor: pointer;

    transition: color .2s;

    &:hover {
        color: var(--white);
        background-color: var(--quinary);
    }
`
